// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

library SpeciesLibrary {
    enum Species { 
        MuteSwan, 
        WhiteStork, 
        MallardDuck, 
        GreyHeron, 
        RedNeckedGrebe, 
        WaterRail, 
        CommonTern, 
        Goosander, 
        GreylagGoose, 
        Moorhen,
        Mythical
    }


    struct SpeciesInfo {
        uint256 maxHealth;
        uint256 maxHunger;
        uint256 hungerDecayRate;
        uint256 poisoningChance;
        string imageUrl;
    }

    function getSpeciesPrice(Species species) internal pure returns (uint256) {
        if (species == Species.MuteSwan) return 0.05 ether;
        if (species == Species.WhiteStork) return 0.05 ether;
        if (species == Species.MallardDuck) return 0.02 ether;
        if (species == Species.GreyHeron) return 0.03 ether;
        if (species == Species.RedNeckedGrebe) return 0.018 ether;
        if (species == Species.WaterRail) return 0.01 ether;
        if (species == Species.CommonTern) return 0.01 ether;
        if (species == Species.Goosander) return 0.012 ether;
        if (species == Species.GreylagGoose) return 0.04 ether;
        if (species == Species.Moorhen) return 0.01 ether;
        if (species == Species.Mythical) return 0.2 ether;
        revert("Unknown species");
    }

    function getSpeciesInfo(Species species) internal pure returns (SpeciesInfo memory) {
        if (species == Species.MuteSwan) {
            return SpeciesInfo(200, 150, 3, 1, "https://gateway.pinata.cloud/ipfs/bafybeia3le4astknh2p4mbkd5w42j522tnse4wxk7w5m7wimoqdp6ouzpy");
        } else if (species == Species.WhiteStork) {
            return SpeciesInfo(220, 200, 2, 5, "https://gateway.pinata.cloud/ipfs/bafybeigohotok6k3onvtjyypfnbnzbcso2qcixbwz4wh64vp2n3lq7nksa");
        } else if (species == Species.MallardDuck) {
            return SpeciesInfo(80, 80, 3, 6, "https://gateway.pinata.cloud/ipfs/bafybeiev7pucz7yh7x6haidmphp5ieobvcfdclnlwjqa2ivs4y357pvwma");
        } else if (species == Species.Mythical) {
            return SpeciesInfo(300, 300, 1, 0, "https://gateway.pinata.cloud/ipfs/bafybeietbf5qosrybqgkq2cd4czv66dww6st4wj5xloze4enb2d5xyj6pm");
        } else if (species == Species.GreyHeron) {
            return SpeciesInfo(180, 90, 2, 4, "https://gateway.pinata.cloud/ipfs/bafybeifxnqrpp3afajntrnwyynu2lcrzvmdmsthwab6x2wn23wcnbdjn6m");
        } else if (species == Species.RedNeckedGrebe) {
            return SpeciesInfo(80, 70, 2, 8, "https://gateway.pinata.cloud/ipfs/bafybeibcdpzpyg6mqae2ogowuumymqmqxb2usniu75geej4ptr467ot2nm");
        } else if (species == Species.WaterRail) {
            return SpeciesInfo(50, 60, 4, 5, "https://gateway.pinata.cloud/ipfs/bafkreida4apspxtnpb63oqyzv3tin5owc45lgctkdqv74hjas4fytookta");
        } else if (species == Species.CommonTern) {
            return SpeciesInfo(55, 40, 3, 4, "https://gateway.pinata.cloud/ipfs/bafkreih2fmxu3ayscr7xez2u2ashawifc3oj4qa26j56ch46vez7zyaej4");
        } else if (species == Species.Goosander) {
            return SpeciesInfo(78, 65, 2, 4, "https://gateway.pinata.cloud/ipfs/bafkreid3mdymzsjtudm56zrovitxouvgsjbzzkyarsq7t2i2biwyg6rhtq");
        } else if (species == Species.GreylagGoose) {
            return SpeciesInfo(150, 100, 4, 3, "https://gateway.pinata.cloud/ipfs/bafkreif6eno2qjj3xc7mebql2s66ol6yxrwx7gwavz44qn2dlz3cnw7f24");
        } else if (species == Species.Moorhen) {
            return SpeciesInfo(35, 66, 4, 5, "https://gateway.pinata.cloud/ipfs/bafybeifpajbivhhemjefgiamnvh7oe27lextqj7agpznchqeujcn46i5ca");
        }
        revert("Unknown species");
    }

}

contracts/Ptak.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "./SpeciesLibrary.sol";

contract Ptak {
    using SpeciesLibrary for SpeciesLibrary.Species;

    struct BirdData {
        uint256 age;
        uint256 hunger;
        uint256 health;
        SpeciesLibrary.Species species;
        uint256 lastUpdateTime;
        bool isDead;
        uint256 deathTimestamp;
    }

    mapping(uint256 => BirdData) public birds;
    uint256 public nextId;
    address public parkContract;
    mapping(uint256 => bool) public insured;
    mapping(uint256 => address) public ownerOf;


    modifier onlyPark() {
        require(msg.sender == parkContract, "Only Park can call this");
        _;
    }

    constructor(address _parkContract) {
        parkContract = _parkContract;
    }

    function mintBird(SpeciesLibrary.Species species) external onlyPark returns (int) {
        SpeciesLibrary.SpeciesInfo memory info = SpeciesLibrary.getSpeciesInfo(species);
        birds[nextId] = BirdData(0, 0, info.maxHealth, species, block.timestamp, false, 0);
        ownerOf[nextId] = msg.sender;
        nextId++;
        return 0;
    }

    function updateHungerAndAge(uint256 id) public {
        BirdData storage bird = birds[id];
        if (bird.isDead) return;

        uint256 timeElapsed = block.timestamp - bird.lastUpdateTime;
        if (timeElapsed > 0) {
            SpeciesLibrary.SpeciesInfo memory info = SpeciesLibrary.getSpeciesInfo(bird.species);

            uint256 hungerIncrease = (timeElapsed * info.hungerDecayRate) / 3600;
            bird.hunger += hungerIncrease;

            if (bird.hunger > info.maxHunger) {
                uint256 overflow = bird.hunger - info.maxHunger;
                bird.hunger = info.maxHunger;
                if (bird.health <= overflow) {
                    bird.health = 0;
                    bird.isDead = true;
                    bird.deathTimestamp = block.timestamp;
                } else {
                    bird.health -= overflow;
                }
            }

            uint256 daysPassed = timeElapsed / 86400;
            if (daysPassed > 0) {
                bird.age += daysPassed;
            }

            bird.lastUpdateTime = block.timestamp;
        }
    }

    function getBirdImage(uint256 birdId) external view returns (string memory) {
        BirdData storage bird = birds[birdId];
        return SpeciesLibrary.getSpeciesInfo(bird.species).imageUrl;
    }

    function healBird(uint256 birdId) external onlyPark {
        BirdData storage bird = birds[birdId];
        require(!bird.isDead, "Cannot heal a dead bird; revive it first");

        bird.health = SpeciesLibrary.getSpeciesInfo(bird.species).maxHealth;
    }

    function randomPoisoning(uint256 birdId) private {
        SpeciesLibrary.SpeciesInfo memory info;
        Ptak.BirdData storage bird = birds[birdId];
        info = SpeciesLibrary.getSpeciesInfo(bird.species);

        if(!insured[birdId]){
            uint256 chance = SpeciesLibrary.getSpeciesInfo(bird.species).poisoningChance;
            uint256 rand = uint256(keccak256(abi.encodePacked(block.timestamp, birdId))) % 100;

            if(rand < chance) {
                bird.health -= 25;
            }
        }
    }

    function feedBird(uint256 id, uint256 foodAmount) external onlyPark {
        updateHungerAndAge(id);
        BirdData storage bird = birds[id];
        randomPoisoning(id);

        require(!bird.isDead, "Cannot feed a dead bird");

        if(bird.hunger >= foodAmount){
            bird.hunger -= foodAmount;
        } else {
            bird.hunger = 0;
        }
    }

    function revive(uint256 birdId) external onlyPark {
        BirdData storage bird = birds[birdId];
        require(bird.isDead, "Not dead");
        bird.health = SpeciesLibrary.getSpeciesInfo(bird.species).maxHealth;
        bird.hunger = 0;
        bird.isDead = false;
        bird.deathTimestamp = 0;
        bird.lastUpdateTime = block.timestamp;
    }

    function insure(uint256 birdId) external onlyPark {
        insured[birdId] = true;
    }

    function getBird(uint256 id) external returns (BirdData memory) {
        updateHungerAndAge(id);
        return birds[id];
    }

    function setParkContract(address _parkContract) external {
        require(parkContract == address(0), "Park already set");
        parkContract = _parkContract;
    }

    function transferBird(uint256 birdId, address newOwner) external onlyPark {
        require(ownerOf[birdId] == tx.origin, "Not the owner");
        require(newOwner != address(0), "Invalid address");
        ownerOf[birdId] = newOwner;
    }
}

